import React from "react";
import { Link } from "react-router-dom";
const EVENTS = [
  { id: "e1", title: "some event" },
  { id: "e2", title: "more event" },
];

function Events() {
  return (
    <>
      <h1>Events</h1>
      {EVENTS.map((event) => {
        <li key={event.id}>
          <Link to={event.id}> {event.title} </Link>
        </li>;
      })}
    </>
  );
}

export default Events;
